import {temp_img} from "../src/images/temp_img.svg";

const Sdata = [
    {
        head:"Web Development",
        imgsrc:temp_img
    },
    {
        head:"Web Designing",
        imgsrc:temp_img,
    },
    {
        head:"Web Application Developemnt",
        imgsrc:temp_img
    },
    {
        head:"Python Software Development",
        imgsrc:temp_img
    },
    {
        head:"Database Administrator",
        imgsrc:temp_img
    },
    {
        head:"Database Administrator",
        imgsrc:temp_img
    }
]; 

export default Sdata;
